/**
 * PDF VFS: Vendored fonts (Roboto + Cairo) for pdfmake.
 * Generated by: node scripts/build-pdf-vfs.mjs
 *
 * Fonts folder: supabase/functions/_shared/fonts/
 * Required: Roboto-Regular.ttf, Roboto-Medium.ttf, Roboto-Italic.ttf, Cairo-Regular.ttf, Cairo-Bold.ttf
 */
const VENDORED_VFS: Record<string, string> = {"Roboto-Regular.ttf":"","Roboto-Medium.ttf":"","Roboto-Italic.ttf":"","Cairo-Regular.ttf":"","Cairo-Bold.ttf":""};

/** Returns the full VFS from vendored fonts. No external source needed. */
export function getVendoredVfs(): Record<string, string> {
  return { ...VENDORED_VFS };
}

/** Decode base64 font to bytes. Returns null if key missing or empty. */
export function getFontBytes(filename: string): Uint8Array | null {
  const b64 = VENDORED_VFS[filename];
  if (!b64) return null;
  const binary = atob(b64);
  const bytes = new Uint8Array(binary.length);
  for (let i = 0; i < binary.length; i++) bytes[i] = binary.charCodeAt(i);
  return bytes;
}

/** Whether Cairo (Arabic) fonts are available. */
export function hasCairoFonts(): boolean {
  return !!(VENDORED_VFS["Cairo-Regular.ttf"] && VENDORED_VFS["Cairo-Bold.ttf"]);
}
